import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class SwapiService {

  constructor( private http:HttpClient) { }
  getSwapi(){
     this.http.get("https://swapi.dev/api/films").toPromise()

  }           
}
